from math import gcd
def a159065(n):
    c=0
    for a in range(1, n):
        for b in range(1, n):
            if gcd(a, b)==1:
                c+=(n - a)*(n - b)
                if 2*a<n and 2*b<n:c-=(n - 2*a)*(n - 2*b)
    return c
